import React from "react";
import { Link } from "react-router-dom";
import Button from "react-bootstrap/Button";
import Usuario from "./components/cadastroUsuario";
import Veiculo from "./components/cadastroVeiculo";
import Busca from "./components/buscaVeiculo";
import "./App.css";

function App() {
  return (
    <>
      <div className="content-App">
        <h1> Bem vindo ao ParkSys</h1>
        <Link to={Usuario}>
          <Button variant="primary">Cadastro Usuario</Button>
        </Link>
        <Link to={Veiculo}>
          <Button variant="primary">Cadastro Veiculo</Button>
        </Link>
        <Link to={Busca}>
          <Button variant="primary">Buscar Veiculos</Button>
        </Link>
      </div>
    </>
  );
}

export default App;
